import React from 'react';
import goodsStyles from '../index.css';

function Goods() {
  return (
    <main>
      <ul className="card-set list">
        <li className="card-set__item">
          <a href="" className="card-set__link link">
            <div className="card">
              <img src="./src/components/img/goods.png" alt="" />
            </div>
          </a>
        </li>

        <li className="card-set__item">
          <a href="" className="card-set__link link">
            <div className="card">
              <img src="./src/components/img/goods.png" alt="" />
            </div>
          </a>
        </li>

        {/* Решта коду для карточок товарів */}
      </ul>
    </main>
  );
}

export default Goods;
